const link = "../../productIMGS/"
const initialState = {
    products : {
        accessories : {
            men: [],
            woman : [],
            kids: [],
        },
        bags : {
            men: [],
            woman : [],
            kids: [],
        },
        denim : {
            men: [],
            woman : [],
            kids: [],
        },
        "t-shirts" : {
            men: [],
            woman : [],
            kids: [],
        }
    }


}
export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
